description:
Today was the last straw that broke the camel's back for Ike. The professor that he is assisting came in late for class because she didn't read the memo that the dean sent out of all the professors and students. Ike is going to go to the dean to relieve himself of his duties unless Ms. Jaymes can change how he is being treated or give him the assignment of fucking her after every class.



